// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
// import "../contracts/Whitelist.sol";

contract CoralAgroOcto is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;
    Counters.Counter private _teamTokenIds;
    address contractAddress;
    uint256 public constant NFT_PRICE = 100000000000000000; //0.1 ETH
    bool public saleIsActive = false;

    uint16 public MAX_SUPPLY;
    uint8 public TEAM_SUPPLY;

    mapping(string => bool) public _colorExists;
    mapping(address => bool) whitelistedAddresses;

    constructor(address marketplaceAddress, uint16 maxNftSupply, uint8 maxTeamSupply) ERC721("Coral Playground - Agro Octo", "CORAL_AGRO_OCTO") {
        contractAddress = marketplaceAddress;
        require(maxNftSupply > 0, "Max supply must be greater than 0");
        MAX_SUPPLY = maxNftSupply;
        TEAM_SUPPLY = maxTeamSupply;
    }

    modifier isWhitelisted(address _address) {
      require(whitelistedAddresses[_address], "Whitelist: You need to be whitelisted");
      _;
    }

    function withdraw() public onlyOwner {
        uint balance = address(this).balance;
        payable (msg.sender).transfer(balance);
    }

    /*
    * Pause sale if active, make active if paused
    */
    function flipSaleState() public onlyOwner {
        saleIsActive = !saleIsActive;
    }

    function whitelistUser(address _addressToWhitelist) public onlyOwner {
      whitelistedAddresses[_addressToWhitelist] = true;
    }
    function removeWhitelistUser(address _addressToWhitelist) public onlyOwner {
      whitelistedAddresses[_addressToWhitelist] = false;
    }

    function checkUserWhitelist(address _whitelistedAddress) public view returns(bool) {
      bool userIsWhitelisted = whitelistedAddresses[_whitelistedAddress];
      return userIsWhitelisted;
    }

    function createToken(string memory tokenURI, string memory _color) public payable returns (uint) {

        require(saleIsActive, "Sale must be active to mint Octo");
        require(_tokenIds.current() < MAX_SUPPLY, "Sorry, all tokens have been minted. Stay tuned for our next drop!");
        require(_colorExists[_color] == false, "An NFT with the same colors has already been minted. Please select a different color pattern");

        if  (msg.sender == owner() ) {
            require(_teamTokenIds.current() < TEAM_SUPPLY, "Sorry, all founding team tokens have been minted");
            _teamTokenIds.increment();
        } else if (whitelistedAddresses[msg.sender] ==  true ) {
            whitelistedAddresses[msg.sender] = false;
        } else {
            require( msg.value >= NFT_PRICE, "Insufficient funds provided");
        }

        _tokenIds.increment();
        uint256 newItemId = _tokenIds.current();

        _safeMint(msg.sender, newItemId);
        _setTokenURI(newItemId, tokenURI);
        setApprovalForAll(contractAddress, true);
        _colorExists[_color] = true;
        return newItemId;
    }

